define({"topics" : [{"title":"Extension Call Pickup","shortdesc":"\n                  <p class=\"shortdesc\">When a user wants to pick up a call that is ringing at the other extension that is         not in the same pickup group, the\n                     user can dial \"Extension Pickup feature code (default *04)         + Extension Number\" to pick up the call. \n                  </p>\n               ","id":"concept_cqp_lmm_4fb","href":"topic\/extension_call_pickup.html","menu": {"hasChildren":false,},"tocID":"concept_cqp_lmm_4fb-d46e11310","next":"concept_cqp_lmm_4fb-d46e11310",},{"title":"Group Call Pickup","shortdesc":"\n                  <p class=\"shortdesc\">If extension users are in the same pickup group, they can dial the Group Call Pickup         feature code (default *4) to\n                     pick up the group member&apos;s incoming call.\n                  </p>\n               ","id":"concept_wsz_nmm_4fb","href":"topic\/group_call_pickup.html","menu": {"hasChildren":false,},"tocID":"concept_wsz_nmm_4fb-d46e11448","next":"concept_wsz_nmm_4fb-d46e11448",}]});